import React, { useState, useEffect } from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';
import ClickyButton from './clicky-button'

const origin = 'http://localhost:3000';

function App() {
  const [teams, setTeams] = useState("");
  const [buttonClicks, setButtonClicks] = useState(0);

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await axios.get(`${origin}/api/v1/rosters`);
        setTeams(response.data.rows[0].team_name)
      } catch(err) {
        console.error(err) 
      }
    }
    fetchData()
  }, [])

  const teamPanel = teams ?
  (<div className="team-names">
    {teams}
    </div>)
    : null

  return (
    <div className="App">
        {teamPanel}
        {/* <button onClick={() => setButtonClicks(buttonClicks+1)}>
          click me
        </button>
        {buttonClicks} */}
        <ClickyButton ButtonClicks={buttonClicks} setButtonClicks={setButtonClicks} />
    </div>
  );
}

export default App;
